import './App.css';
import './Tarjeta.scss';
import React from 'react';

const Tarjeta = ({titulo, alerta, auditor, fecha}) => {
    return (
        <div className="Tarjeta" key={id}>
            <div className="Tarjeta-superior">
                <div className="Tarjeta-superior-izq">{titulo}</div>
                <div className="Tarjeta-superior-der">{alerta}</div>
            </div>
            <div className="Tarjeta-inferior">
                <div className= "Tarjeta-inferior-auditor"> Auditor: {auditor}</div>
                <div className= "Tarjeta-inferior-fecha">Fecha: {fecha}</div>
            </div>
        </div>
    );
}

export default Tarjeta;
